//import highlightPage from './highlightPage';

// THE VIEW RENDERING OBJECT 
class View extends Component { 
	render() { 
		return(
			<div 
				style = {{ backgroundImage: 'url(' + 'https://www.google.com/images/branding/googlelogo/2x/googlelogo_color_272x92dp.png' + ')',
                backgroundSize: 'cover',
                backgroundPosition: 'center center',
                backgroundRepeat: 'no-repeat',
				}}>
				<Box height="100%" background="blue" fill={true}> 
					<Navbar />
				</Box> 
			</div>
		);	
	}
} 

export default View;

